import React, { useState } from "react";
import { Basic } from "react-dial-knob";

// You can try Basic, White, Silver or HighContrast skins

class AngleDial extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: null,
    };
  }
  render() {
  return (<Basic
        diameter={200}
        min={0}
        max={360}
        step={1}
        value={this.state.value}
        theme={{
            donutColor: 'lightcoral'
        }}
        style={{
          position: 'relative',
          margin: '100px auto',
          width: '200px'
        }}
        onValueChange={() => this.setState({value: this.props.value})}
        ariaLabelledBy={'my-label'}
        spaceMaxFromZero={false}
    >
        <label id={'my-label'} style={{
          textAlign: 'center',
          width: '200px',
          display: 'block',
          padding: '10px 0'
        }}>My Label</label>
    </Basic> );
    }
}


export default AngleDial;
